import React from 'react';
import {AiOutlinePlus} from 'react-icons/ai';
import SuggestionCard from '../card_sugges/card_sugges_json';
import ModalData from './modal_json'
class Modal extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return(
      <div id="modal">
        <button type="button" className="btn btn-info btn-lg" data-toggle="modal" data-target="#myModal">  <center><img className=" card-img-top img-fluid" src={item.url}/></center></button>
        <div className="modal fade" id="myModal" role="dialog">
          <div className="modal-dialog">
          {ModalData.map((item)=>{
            return(
              <div className="modal-content">
                <div className="modal-header">
                  <h4 className="modal-title">{item.head}</h4>
                    <button type="button" className="close" data-dismiss="modal">&times;</button>
                </div>
                <div className="modal-body">
                  <div dangerouslySetInnerHTML={{__html:item.text}}>
                  </div>
                </div>
                <div className="modal-footer">
                  <button type="button" className="btn btn-default" data-dismiss="modal">Close</button>
                </div>
              </div>

            )
          }
          )}

        </div>
      </div>
    </div>
    )
  }
}
export default Modal
